import React from 'react';
import { Nav, Navbar, Form, FormControl } from 'react-bootstrap';
import NotificationIcon from '@material-ui/icons/Notifications';
import EmailIcon from '@material-ui/icons/Email';
import DropdownIcon from '@material-ui/icons/ArrowDropDownOutlined';
import styled from 'styled-components';

const Styles = styled.div`
  .navbar { background-color: blue; }
  a, .navbar-nav, .navbar-light .nav-link {
    color: white;
    &:hover { color: white; }
  }
  .navbar-brand {
    font-size: 1.4em;
    color: #9FFFCB;
    &:hover { color: white; }
  }
  .form-center {
    position: absolute !important;
    left: 20%;
    right: 50%;
  }
`;

export const NavigationBar = () => (
  <Styles>
    <Navbar expand="lg">
      <Navbar.Brand >Doodle</Navbar.Brand>
      <Form className="form-center">
        <FormControl type="text" placeholder="Search" className="" />
      </Form>
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="ml-auto">
          <Nav.Item><Nav.Link href="/add">+ Add</Nav.Link></Nav.Item> 
          <Nav.Item><Nav.Link href="/email"><EmailIcon /></Nav.Link></Nav.Item>
          <Nav.Item><Nav.Link href="/id">Name<DropdownIcon /></Nav.Link></Nav.Item>
          <Nav.Item><Nav.Link ><NotificationIcon /></Nav.Link></Nav.Item>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  </Styles>
)
